def char_freq(string):
    dic = {}
    for i in string:
        dic[i]=0
    for i in string:
        dic[i]=dic[i]+1
    return dic

def char_freq_file(file):
    dic = {}
    f = open(file, 'r')
    string = f.read()
    for i in string:
        dic[i]=0
    for i in string:
        dic[i]=dic[i]+1
    return dic

def histogram(dict_freq):
    for key in dict_freq.keys():
        print(key, '*' * dict_freq[key])
        
    
